import React, {useState} from 'react';
import ReactMapGL, { Marker } from "react-map-gl";
// import * parkDate from "../data/skateboard.json";

function Park() {
const [viewport,setViewpoint] = useState({
    latitude: 39.55555,
    longitude: -75.163526,
    width: "100vw",
    height: "100vh",
    zoom: 10
});
require("dotenv").config()
 return ( 
     <div>
         <ReactMapGL
         {...viewport}
         mapboxApiAccessToken = {process.env.REACT_APP_MAPBOX_TOKEN}
         mapStyle = "mapbox://styles/benngo89/cjy51v2yf0aru1coxq4swjwje"
          onViewportChange={viewport => {
            setViewpoint(viewport);

          }}
         >
           {/* {parkDate.location.map((park)=>{
             <Marker key={parkDate.location}>
               <div>Skate</div>
             </Marker> */}

        <Marker 
        latitude={37.78} longitude={-122.41} offsetLeft={-20} offsetTop={-10}>
          <div>You are here</div>
        </Marker>
    );
  }
}
           

    
         </ReactMapGL>
     </div>
 );
}

export default Park;
